import './App.css';
import Row from './components/Row';
import requests from './components/Requests';

function App() {
  return (
    <div className="App">
     <Row title="Netflix Originals" fetchUrl={requests.fetchNetflixOriginals}/>
     <Row title="Treanding Now" fetchUrl={requests.fetchTrending}/>
     <Row title="Action Movies" fetchUrl={requests.fetchActionMovies}/>
     <Row title="Comedy Movies" fetchUrl={requests.fetchComedyMovies}/>
     <Row title="Horrer mo" fetchUrl={requests.fetchHorrorMovies}/>
     <Row title="Treanding Now" fetchUrl={requests.fetchRomanceMovies}/>
     <Row title="Treanding Now" fetchUrl={requests.fetchDocumentaries}/>






    </div>
  );
}

export default App;
